import React, {useState} from 'react';
import './App.css';
import Navigation from "./components/Navigation";
import Questions from "./components/Questions";
import Question from "./components/Question";
import AskQuestion from "./components/AskQuestion";

    const introMessage = "Welcome to developers Q/A Community!";
    const introSubMessage = "Feel free to help or get help for/from community members!";

function App() {

    const [questions, setQuestions] =  useState([
        {
            id : 0,
            title : 'What is Javascript',
            subtitle : 'I need more information about it',
            category : 'Javascript',
            up : 0,
            answers : ['']
        },
        {
            id : 1,
            title : 'How to do map() function',
            subtitle : 'Can someone tell how to do it step by step',
            category : 'Javascript',
            up : 0,
            answers : ['']
        },{
            id : 2,
            title : 'MongoDB or firebase?',
            subtitle : 'Cant decide...',
            category : 'Databases',
            up : 4,
            answers : ['']
        },{
            id : 3,
            title : 'Any good tutorials for ES6',
            subtitle : 'Want to start practice, but dunno where',
            category : 'Javascript',
            up : 0,
            answers : ['']
        }
    ])

    const quest = {
        title: '',
        subtitle: '',
    };

    const [questState, setQuestState] = useState([
        {...quest}
    ])

    const addQuest = () => {
        setQuestState([...questState, {...quest}]);
    }


    //1. Suzinok kaip is input values padaryt viena objekta
    //2. Are ein is child component ta object i parent dakelti ir kad i questions array ikist


    return (
    <div className="App">
        <input type="text" placeholder="for testing" />
        <button onClick={addQuest}>Submit</button>
        <Navigation />
      <h1>{introMessage}</h1>
      <p>{introSubMessage}</p>
        <Questions questions={questions} />
        <Question questions={questions} />
        <AskQuestion questions={questions} />
    </div>
  );
}

export default App;
